import React from "react";
import axios from "axios";
import "./Task.css";
import react, { useEffect, useState } from "react";
import TaskEdit from "../../components/modals/TaskAdd";
import { DragDropContext, Draggable, Droppable } from "react-beautiful-dnd";

const Task = () => {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    loadProduct();
  }, []);

  const loadProduct = async () => {
    await axios.get("http://localhost:3003/task").then((res) => {
      setUsers(res.data);
    });
  };

  const DeleteProduct = async (id) => {
    await axios.delete(`http://localhost:3003/task/${id}`);
    loadProduct();
    setAnchorEl(null);
  };
  const [anchorEl, setAnchorEl] = useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };
  const onEnd=()=>{

  }
  return (
	
	<DragDropContext onDragEnd={onEnd}>
		<Droppable droppableId="1234">
			{(provided,snapshot)=>(
				<div ref={provided.innerRef()}>
					{users.map((item,i)=>(
					<Draggable draggableId={item.id} key={item.id} >
						{(provided,snapshot)=>(
							<div ref={provided.innerRef()} {...provided.draggableProps} {...provided.dragHandleProps}>
									{item.name}
							</div>
						)}
					</Draggable>	
					))}

				</div>
			)}
	</Droppable>
	</DragDropContext>
  );
};

export default Task;
